import React from 'react';

import ThemeContext from '../../context/theme';
import { Section, Card } from '../Globals';

class NewGames extends React.Component {
  static contextType = ThemeContext;

  render() {
    return (
      <Section style={{ overflow: 'scroll' }}>
        <Section>
          <Card
            style={{
              height: '100px',
              width: '100px',
              borderRadius: '50%',
              margin: '10px'
            }}
          >
            1
          </Card>
        </Section>
        <Section>
          <Card>2</Card>
        </Section>
        <Section>
          <Card>3</Card>
        </Section>
        <Section>
          <Card>4</Card>
        </Section>
        <Section>
          <Card>5</Card>
        </Section>
        <Section>
          <Card>6</Card>
        </Section>
        <Section>
          <Card>7</Card>
        </Section>
        <Section>
          <Card>8</Card>
        </Section>
      </Section>
    );
  }
}

export default NewGames;
